import React from "react";
import PropTypes from "prop-types";
import TextFields from "./flightChooser";
import { withStyles } from "@material-ui/core/styles";
import LandingText from "./landingText";
import BelowLanding from "./belowLanding";
import NumberCrunch from "./numbercrunch";
import SoFunktionierts from "./sofunktionierts";

const styles = theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap",
    position: "relative",
    direction: "column"
  },
  dense: {
    marginTop: 19
  },
  menu: {
    width: 200
  }
});

class Landing extends React.Component {
  state = {
    name: "",
    age: "",
    multiline: "Controlled",
    landing: "landing"
  };

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value
    });
  };

  render() {
    const { classes } = this.props;

    return (
      <div className={`${classes.container} ${this.state.landing}`}>
        <TopPicture />
        <LandingText />
        <TextFields />
        <BelowLanding />
        <NumberCrunch />
        <SoFunktionierts />
      </div>
    );
  }
}

Landing.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Landing);
